import {combineReducers} from "redux";

import stateTable from "../serverViewType/reducers/reducerViewType";
import WindowCreateNewData from "../serverViewType/reducers/reducerWindowCreateNewData";
import stateTable_EltypeClass from '../EltypeClasse/reducers/reducerEltypeClasse';
import WindowCreateData_EltypeClass from '../EltypeClasse/reducers/reducerWindowCreateEltypeClass';


const rootReducer = combineReducers({
    stateTable,
    WindowCreateNewData,
    stateTable_EltypeClass,
    WindowCreateData_EltypeClass
})

export default rootReducer
